import React, { Component } from "react";

export default class CreateTodo extends Component {
  state = {
    description: "",
    responsible: "",
    priority: "",
    completed: false
  };

  onChangeDescription(e) {
    this.state({
      description: e.target.value
    });
  }
  onChangeresponsible(e) {
    this.state({
      responsible: e.target.value
    });
  }
  onChangepriority(e) {
    this.state({
      description: e.target.value
    });
  }
  render() {
    return (
      <div>
        <h1>createtodo</h1>
      </div>
    );
  }
}
